import { Link } from "react-router-dom";
import { useSelector} from "react-redux";
import * as selectors from '../../redux/users/user-selector'
import s from './List.module.css'
import FavoriteCardButton from "../FavoriteCardButton";
import { useState } from "react";
import ListItem from "../ListItem";



// import { Button } from "@mui/material";
export default function List() {
    const repositories = useSelector(selectors.getState);


    return (
        <div className={s.card_container}>

            <ul className={s.gallery__list}>{repositories.map((repo) => (<ListItem key={repo.id} repo={repo}/>))}

            </ul>
        </div>
    );}
